import React, { useEffect, useState } from "react";
import axios from "axios";
import Ticker from "react-ticker";

const NewsTicker = () => {
  const [news, setNews] = useState([]);
  useEffect(() => {
    axios
      .get("http://localhost:4444/proxyServer/traffic_news")
      .then((res) => {
        setNews(res.data);
      })
      .catch((err) => {
        console.error(err);
      });
  }, []);

  useEffect(() => {
    console.log(news);
  }, [news]);

  return (
    <Ticker>
      {() => (
        <>
          <h1>{news}</h1>
        </>
      )}
    </Ticker>
  );
};

export default NewsTicker;
